import React from 'react'
import { Result, Button } from 'antd';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'
import App from "./App";

const Notfound = (
  <Result
    status="404"
    title="404"
    subTitle="Sorry, the page you visited does not exist."
    extra={
      <div>
      <Button type="primary">
        <span>Back Home</span>
      </Button>
      <Link to="/" />
      </div>
  }
  />
)
export default Notfound
